import React from 'react'
// Bootstrap
import 'bootstrap/dist/css/bootstrap.min.css';
import { Dropdown } from 'react-bootstrap';

const sort = () => {

}

const SortBy = () => {
    return (
        <div class="sortBy">
            <label class="lblSortBy">SortBy: </label>
            <DropdownButton id="dropdown-basic-button" title="Dropdown button">
                <Dropdown.Item href="#/action-1">Action</Dropdown.Item>
                <Dropdown.Item href="#/action-2">Another action</Dropdown.Item>
                <Dropdown.Item href="#/action-3">Something else</Dropdown.Item>
            </DropdownButton>
            <div class="dropdown">
                <label class="lblSortBy">SortBy: </label>
                <a class="btnSortBy btn btn-light dropdown-toggle" type="button" id="sortDropDown" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                    Select
                </a>
                <ul class="dropdown-menu" aria-labelledby="sortDropDown">
                    <li><a class="dropdown-item" href="#">Action</a></li>
                    <li><a class="dropdown-item" href="#">Another action</a></li>
                    <li><a class="dropdown-item" href="#">Something else here</a></li>
                </ul>
                <div class="float-right">
                    <label class="lblCompare">Select Three Resorts</label>
                    <button class="btnCompare btn btn-light">Compare</button>
                </div>
            </div>
        </div>
    )
};


export { SortBy }
